    return (
        <>       
                <a href='/contact'>Contact</a>
                <a href='/contact/about'>About page</a><br></br>

                {/* <Link to="/contact">Contact Us    </Link>
                <Link to="/contact/about">About Us</Link> */}

                <NavLink  activeClassName= "active" to="/contact">Contact Us </NavLink>
                <NavLink exact to="/contact/about">About Us</NavLink>

        </>
    )
})
export default Menu
